import { connect } from "react-redux";
import { ch, fl, mk, su, uw } from "../../redux/users";
import New from "./New";

const mapStateToProps = (state) => {
  return {
    users: state.usersReducer.users,
    mpage: state.usersReducer.mpage,
    mklient: state.usersReducer.mklient,
    mpageq: state.usersReducer.mpageq,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    folow: (userID) => {
      dispatch(fl(userID));
    },
    unfolow: (userID) => {
      dispatch(uw(userID));
    },
    setusers: (user) => {
      dispatch(su(user));
    },
    setch: (userch) => {
      dispatch(ch(userch));
    },
    mkklient: (usermk) => {
      dispatch(mk(usermk));
    },
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(New);

